// [[Rcpp::plugins(cpp11)]]
// [[Rcpp::export]]
double doubleDip(const std::vector<double>& x) {
  //std::vector<double> x = xIn;
  //std::sort(std::begin(x), std::end(x)); //begin by sorting the data vector in place.
  double currentDip = 1.0;
  double tmpDip = 1.0;
  double dip_1 = 0, dip_2 = 0;
  double *p_dip_1 = &dip_1, *p_dip_2 = &dip_2;
  const int N = x.size();
  if (N > 500) {
    std::cerr << "P-values for more than 500 observations not supported" << std::endl;
    return -1.0;
  }
  int N1 = 0, N2 = 0;
  int *n1 = &N1;
  int *n2 = &N2;
  
  int ifault = 0;
  int *ifault_1 = &ifault;

  std::vector<int> lo_hi_1(4,0);
  std::vector<int> lo_hi_2(4,0);
  const int min_is_0 = 0;
  const int *min_is_0_1 = &min_is_0;
  const int debug_status = 0;
  const int *debug_1 = &debug_status;

  //allocate on heap
  double* X = new double[N];
  int* gcm = new int[N];
  int* lcm = new int[N];
  int* mn = new int[N];
  int* mj = new int[N];
  /*
  double X [N];
  int gcm [N];
  int lcm [N];
  int mn [N];
  int mj [N];
  */
  //Initialize X
  for (int k=0; k < N; k++) {
    X[k]=x[k];
    gcm[k]=0;
    lcm[k]=0;
    mn[k]=0;
    mj[k]=0;
  }
  double ratio_1, ratio_2, temp_dip_1, temp_dip_2;
  //Iteratively compute DIP
  for (int i = 2; i < (N-2); i++) {
    N1 = i;
    cppdip(&X[0], n1, p_dip_1, lo_hi_1, ifault_1,
	   &gcm[0], &lcm[0], &mn[0], &mj[0],
	   min_is_0_1, debug_1);
    ifault = 0; //reset ifault for next call
    ratio_1 = ((double) i)/(std::sqrt((double) N));
    temp_dip_1 = (*p_dip_1) * ratio_1;

    //upper limit of GCM LCM compuatations now lower limits; reset
    gcm[i] = 0;
    lcm[i] = 0;
    mn[i] = 0;
    mj[i] = 0;
    N2 = (N-i);
    cppdip(&(X[i]), n2, p_dip_2, lo_hi_2, ifault_1,
	   &(gcm[i]), &(lcm[i]), &(mn[i]), &(mj[i]),
	   min_is_0_1, debug_1);
    ifault = 0; //reset ifault for next call
    ratio_2 = ((double) (N-i))/(std::sqrt((double) N));
    temp_dip_2 = (*p_dip_2) * ratio_2;
    
    //update Dip
    tmpDip = std::min(currentDip,std::max(temp_dip_1,temp_dip_2));
    currentDip = tmpDip;
    //clean up containers for next iteration
    std::fill(lo_hi_1.begin(),lo_hi_1.end(),0);
    std::fill(lo_hi_2.begin(),lo_hi_2.end(),0);
  }
  
  //clean up heap
  delete[] X;
  delete[] gcm;
  delete[] lcm;
  delete[] mn;
  delete[] mj;

  //get significance
  std::vector<double> crit_values = _dip2_critical_values_[(N-1)];
  int cvloc = -1;
  if (crit_values[99] <= currentDip) {
    cvloc = 0;
  }
  else if (crit_values[0] >= currentDip) {
    cvloc = 100;
  }
  else {
    for (int i = 0; i < 99; i++) {
      if ((cvloc == -1) && (crit_values[(i+1)] > currentDip) && (crit_values[i] <= currentDip)) {
	cvloc = 100-i-1;
	break;
      }
    }
  }
  if (cvloc == -1) {
    std::cout << currentDip << std::endl;
    std::cout << crit_values[0] << std::endl;
    std::cout << crit_values[99] << std::endl;
  }
  return ((double(cvloc)/100.0));
}

